import React from 'react'
import { useNavigate } from "react-router-dom";
import styles from './Styles.module.css';

function ErrorPage() {
    let navigate = useNavigate();
    return (
        <div class={styles.mainpagebox}>
            404 Page Not Found
            <p><button onClick={() => {
                    navigate("/");
                }}>Home</button></p>
        </div>
    )
}

export default ErrorPage
